import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Login from "./components/Login";
import Register from "./components/Register";
import EC2DashboardPage from "./components/EC2DashboardPage";

function App() {
  const navigateToEC2Dashboard = () => {
    window.location.href = "http://localhost:3000/ec2-dashboard";
  };

  return (
    <Router>
      <Route exact path="/login" component={Login} />
      <Route exact path="/register" component={Register} />
      <Route exact path="/ec2-dashboard" component={EC2DashboardPage} />
      <Route exact path="/">
        <Login onFormSwitch={navigateToEC2Dashboard} />
      </Route>
    </Router>
  );
}

export default App;
